    fetch("http://localhost:9000/questions")
      .then((res) => res.json())
      .then((data) => console.log(data));
  }, []);
  return (
    <div className="app">
      <Header />

      <Main>
        <p>1/15</p>
        <p>Question?</p>
      </Main>
    </div>
  );
}
